(266, 'https://www.facebook.com/r.php?locale=en_US&display=page', 'Sign Up for Facebook | Facebook', 'Sign up for Facebook and find your friends. Create an account to start sharing photos and updates with people you know. It\'s easy to register.', '', 0),
(267, 'https://es-la.facebook.com/login/', 'Iniciar sesión en Facebook', 'Inicia sesión en Facebook para empezar a compartir y conectarte con tus amigos, tus familiares y las personas que conoces.', '', 0),
(268, 'https://fr-fr.facebook.com/login/', 'Se connecter à Facebook', 'Connectez-vous à Facebook pour commencer à partager et communiquer avec vos amis, votre famille et les personnes que vous connaissez.', '', 0),
(269, 'https://zh-cn.facebook.com/login/', '登录 Facebook', '登录 Facebook，与好友、家人和认识的人分享和建立联系。', '', 0),
(270, 'https://ar-ar.facebook.com/login/', 'تسجيل الدخول إلى فيسبوك', 'قم بتسجيل الدخول إلى فيسبوك لبدء المشاركة والتواصل مع أصدقائك وعائلتك والأشخاص الذين تعرفهم.', '', 0),
(271, 'https://pt-br.facebook.com/login/', 'Entrar no Facebook', 'Entre no Facebook para começar a compartilhar e se conectar com seus amigos, familiares e com as pessoas que você conhece.', '', 0),
(272, 'https://it-it.facebook.com/login/', 'Accedi a Facebook', 'Accedi a Facebook per iniziare a condividere contenuti e connetterti con i tuoi amici, la famiglia e le persone che conosci.', '', 0),
(273, 'https://ko-kr.facebook.com/login/', 'Facebook에 로그인', 'Facebook에 로그인하세요. 친구, 가족, 지인들과 함께 하는 즐거운 Facebook 생활이 시작됩니다.', '', 0),
(274, 'https://de-de.facebook.com/login/', 'Bei Facebook anmelden', 'Melde dich bei Facebook an, um dich mit deinen Freunden, deiner Familie und Personen, die du kennst, zu verbinden und Inhalte zu teilen.', '', 0),
(275, 'https://hi-in.facebook.com/login/', 'Facebook में लॉग इन करें', 'अपने दोस्तों, परिवार और परिचित लोगों से शेयर करना और कनेक्ट करना शुरू करने के लिए Facebook में लॉग इन करें.', '', 0),
(276, 'https://ja-jp.facebook.com/login/', 'Facebookにログイン', 'Facebookにログインして、友達や家族と写真や近況をシェアしましょう。', '', 0),
(277, 'https://www.facebook.com/sideload/lite/googleplay/', 'Facebook Lite - Apps on Google Play', 'This version of Facebook uses less data and works in all network conditions.', '', 0),
(278, 'https://es-la.facebook.com/lite/', 'APK de Facebook Lite para Android', 'Descarga aquí el APK de Facebook Lite. Facebook Lite usa menos datos y funciona en todos los teléfonos Android. Crea una cuenta o inicia sesión en Facebook.', '', 0),
(279, 'https://fr-fr.facebook.com/lite/', 'APK Facebook Lite pour Android', 'Téléchargez l’APK Facebook Lite ici. Facebook Lite utilise moins de données et fonctionne sur tous les téléphones Android. Créez un compte ou...', '', 0),
(280, 'https://zh-cn.facebook.com/lite/', 'Android 版 Facebook Lite APK', '请在这里下载 Facebook Lite APK。使用 Facebook Lite，流量省省省，适用于所有 Android 手机。创建帐户或登录 Facebook 吧！', '', 0),
(281, 'https://ar-ar.facebook.com/lite/', '‫Facebook Lite APK لنظام Android‬', 'يمكنك تنزيل Facebook Lite APK من هنا. يتسهلك Facebook Lite بيانات اتصال أقل ويعمل على جميع هواتف Android. ويمكنك إنشاء حساب أو تسجيل الدخول إلى فيسبوك.', '', 0),
(282, 'https://pt-br.facebook.com/lite/', 'APK do Facebook Lite para Android', 'Baixe a APK do Facebook Lite aqui. O Facebook Lite usa menos dados e funciona em todos os telefones Android. Crie uma conta ou entre no Facebook.', '', 0),
(283, 'https://it-it.facebook.com/lite/', 'APK di Facebook Lite per Android', 'Scarica l\'APK di Facebook Lite qui. Facebook Lite usa meno dati e funziona su tutti i cellulari con Android. Crea un account o accedi a Facebook.', '', 0),
(284, 'https://ko-kr.facebook.com/lite/', 'Android용 Facebook Lite APK', '여기에서 Facebook Lite APK를 다운로드하세요. Facebook Lite는 데이터 소모량이 적으며 모든 Android 휴대폰에서 지원됩니다. 계정을 만들거나 Facebook에 로그인하세요.', '', 0),
(285, 'https://de-de.facebook.com/lite/', 'Facebook Lite-APK für Android', 'Lade hier die Facebook Lite-APK herunter. Facebook Lite verbraucht weniger Daten und funktioniert auf allen Android-Geräten. Erstelle ein Konto oder...', '', 0),
(286, 'https://hi-in.facebook.com/lite/', 'Android के लिए Facebook Lite APK', 'Facebook Lite APK यहाँ डाउनलोड करें. Facebook Lite कम डेटा का उपयोग करता है और सभी Android फ़ोन पर काम करता है. एक खाता बनाएँ और Facebook में लॉग इन करें.', '', 0),
(287, 'https://ja-jp.facebook.com/lite/', 'Android用Facebook Lite APK', 'こちらからFacebook Lite APKをダウンロードできます。Facebook Liteは使用データ量を抑えた設計となっており、すべてのAndroid機器で動作します。アカウントを作成するか、Facebookにログインしてください。', '', 0),
